// src/App.js
// Main application component with routing

import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { AuthProvider } from './contexts/AuthContext';
import ProtectedRoute from './components/ProtectedRoute';

// Marketing pages
import Home from './pages/Home';
import Pricing from './pages/Pricing';
import WhyBodyMap from './pages/WhyBodyMap';
import Contact from './pages/Contact';
import Privacy from './pages/Privacy';
import Terms from './pages/Terms';

// Auth pages
import Signup from './pages/Signup';
import Login from './pages/Login';

// Client pages
import ClientIntake from './pages/ClientIntake';
import ThankYou from './pages/ThankYou';

// Protected pages (will build in Phase 4)
// import Dashboard from './pages/Dashboard';

// Temporary Dashboard placeholder
function DashboardPlaceholder() {
  return (
    <div style={{ 
      padding: '40px', 
      textAlign: 'center',
      fontFamily: 'system-ui, sans-serif' 
    }}>
      <h1 style={{ fontSize: '32px', marginBottom: '16px' }}>ðŸŽ‰ Dashboard Coming Soon!</h1>
      <p style={{ fontSize: '18px', color: '#6B7280', marginBottom: '24px' }}>
        You're successfully logged in! Dashboard will be built in Phase 4.
      </p>
      <p style={{ fontSize: '14px', color: '#9CA3AF' }}>
        Authentication is working perfectly âœ…
      </p>
    </div>
  );
}

function App() {
  return (
    <Router>
      <AuthProvider>
        <Routes>
          {/* Public marketing pages */}
          <Route path="/" element={<Home />} />
          <Route path="/pricing" element={<Pricing />} />
          <Route path="/why" element={<WhyBodyMap />} />
          <Route path="/contact" element={<Contact />} />
          <Route path="/privacy" element={<Privacy />} />
          <Route path="/terms" element={<Terms />} />

          {/* Authentication pages */}
          <Route path="/signup" element={<Signup />} />
          <Route path="/login" element={<Login />} />

          {/* Client intake flow */}
          <Route path="/:customUrl" element={<ClientIntake />} />
          <Route path="/thank-you" element={<ThankYou />} />

          {/* Protected pages (require login) */}
          <Route 
            path="/dashboard" 
            element={
              <ProtectedRoute>
                <DashboardPlaceholder />
              </ProtectedRoute>
            } 
          />
        </Routes>
      </AuthProvider>
    </Router>
  );
}

export default App;
